import React from "react";

export default function Jobs() {
    const [jobs, setjobs] = React.useState([])
    React.useEffect(() => {
        fetch("/api/jobs")
            .then(res => res.json())
            .then(data => setjobs(data.jobs))
    }, [])

    console.log("printing jobs");
    console.log(jobs)

    const jobElements = jobs.map(job => (
        <div key={job.id} className="van-tile">
            <div className="van-info">
                <h3>{job.company}</h3>
                <h3>{job.position}</h3>
                <p>${job.location}<span>/day</span></p>
            </div>
            <i className={`van-type ${job.company} selected`}>{job.company}</i>
        </div>
    ))

    return (
        <div className="van-list-container">
            <h1>Explore Jobs</h1>
            <div className="van-list">
                {jobElements}
            </div>
        </div>
    )
}
